(lib.beamer = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		this.stop();
		
		var num = 9;//Math.round(Math.random() * 6) + 6;
		var gap = 0.04;
		var act_delay = 0;
		var long_size = 0.06;
		var short_size = 0.035;
		var to_duplicate;
		
		var target = 600;
		var t_time = 1;
		var f_time = 0.2;
		var start_time = 0.5;
		var _this = this;
		
		this.bit_long.alpha = 0;
		this.bit_short.alpha = 0;
		
		this.sendBeam = function(){
			
			act_delay = 0;
			for (var i = 0; i < num; i++) {
				if (Math.random() < 0.5) {
					to_duplicate = "bit_long";
				} else {
					to_duplicate = "bit_short";
				}
				var mc = _this[to_duplicate].clone(true);
				mc.x = target;
				mc.y = 0;
				_this.addChild(mc);
				TweenMax.set(mc, {scaleY:3});
				TweenMax.to(mc, t_time, {delay:act_delay, x:0, ease:Linear.easeNone, onComplete:remove_child, onCompleteParams:[mc]});
				TweenMax.to(mc, f_time, {delay:act_delay+start_time, alpha:0.7, scaleY:1, ease:Sine.easeOut});
				TweenMax.to(mc, f_time, {delay:act_delay+t_time-f_time, scaleY:2, alpha:0, ease:Sine.easeOut});
				
				act_delay += to_duplicate == "bit_long" ? long_size : short_size;
				act_delay += gap;
			}
		}
		function remove_child(child){
			_this.removeChild(child);
		}
		this.sendBeam();
		//TweenMax.delayedCall(3, sendBeam);
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(2));

	// Layer 1
	this.bit_long = new lib.bit_long();
	this.bit_long.parent = this;
	this.bit_long.setTransform(10,3,1,1,0,0,0,10,3);

	this.bit_short = new lib.bit_short();
	this.bit_short.parent = this;
	this.bit_short.setTransform(45,3,1,1,0,0,0,3,3);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.bit_short},{t:this.bit_long}]}).wait(2));

}).prototype = p = new cjs.MovieClip();
