						dx_2 = p1.x-p2.x,
						dy_2 = p1.y-p2.y,
						rot_2 = Math.atan2(dy_2, dx_2)*(180/Math.PI),
						
						ca = p1.x - p2.x,
						cb = p1.y - p2.y,
						dist = Math.sqrt( ca*ca + cb*cb ),
					
						alpha = Math.acos( ( arm_length_2*arm_length_2 + dist*dist - arm_length_1*arm_length_1 ) / (2*arm_length_2*dist) )*tweak,
