(lib.stage_contact = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{"open":1});

	// timeline functions:
	this.frame_0 = function() {
		_this = this;
		var inited = false;
		var close_frame = 180;
		var close_length = 29;
		var cross_frame = 41;
		var cross_length = 29;
		var cross_bottom_frame = 210;
		
		var close_time;
		var half_time;
		var closer;
		
		this.is_opening = false;
		this.is_closing = false;
		this.flow = false;
		
		if(!inited){
			inited = true;
			this.stop();
		}
		
		this.open = function(){
			this.vr = false;
			this.endgame = false;
			this.no_end_call = false;
			
			this.cont_anim.open();
			this.gotoAndPlay("open");
			this.is_opening = true;
			this.is_closing = false;
			this.flow = false;
		}
		
		
		this.close = function(goto_bottom){
			var g = "side";
			if(goto_bottom){
				g = "bottom";
			}
			
			close_time = this.parent.close_time;
			half_time = this.parent.half_time;
			this.stop();
			// TODO: incorporate is_opening
			if(this.is_closing){
				//do nottin'
			}else if(this.is_opening){
				var targ_f = close_frame+(close_length-this.cont_anim.currentFrame);
				this.cont_anim.gotoAndPlay(targ_f);
				if(g == "side"){
					this.cont_anim.bg.gotoAndPlay(targ_f);
				}else{
					this.cont_anim.bg.gotoAndPlay(close_bottom_frame+(close_length-this.cont_anim.currentFrame));
				}
				this.cont_anim.cross.gotoAndPlay(cross_frame+(cross_length-this.cont_anim.cross.currentFrame));
			}else{
				this.cont_anim.gotoAndPlay("close");
				this.cont_anim.cross.gotoAndPlay("close");
				
				
				this.cont_anim.bg.gotoAndPlay(g);
			}
			
		}
		
		this.switchIn = function(){
			this.parent.cover.alpha = 0;
			this.parent.bg.alpha = 0;
			this.cont_anim.alpha = 1;
		}
		this.switchBack = function(){
			this.parent.cover.alpha = 1;
			this.parent.bg.alpha = 1;
			this.cont_anim.alpha = 0;
		}
	}
	this.frame_1 = function() {
		this.switchIn();
	}
	this.frame_7 = function() {
		this.stop();
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1).call(this.frame_1).wait(6).call(this.frame_7).wait(1));

	// game_anim
	this.cont_anim = new lib.cont_anim();
	this.cont_anim.parent = this;

	this.timeline.addTween(cjs.Tween.get(this.cont_anim).wait(8));

}).prototype = p = new cjs.MovieClip();
